import React from 'react';
import './Qna.css';
import QnaThumbNail from './QnaThumbNail';
import QnaFilter from './QnaFilter';
import QnaTitleList from './QnaTitleList';
import QnaListItem from './QnaListItem';
import QnaWrite from './QnaWriteBt';
import QnaPageNation from './QnaPageNation';


function Qna() {

    return (
        <div className="Qna">
            <QnaThumbNail />
            <QnaFilter />
            <QnaListItem />
            <QnaTitleList />
            <QnaWrite />
            <QnaPageNation />
        </div>
    );
};

export default Qna;
